Brezplačna aplikacija Generali Investments vam omogoča spremljanje tečajnice, gibanja podskladov Generali Krovnega sklada in donosnosti varčevalnih načrtov ter prebiranje najnovejših obvestil. Prek aplikacije lahko brez obiska poslovalnice, varno in enostavno uredite pristop z video identifikacijo ali pa enostavne poiščete vam najbližjo poslovalnico. Vlagatelji Generali Investments s prijavo pridobite vpogled v aktualno stanje svojih naložb, možnost opravljanja prenosov med podskladi in varno sklepanje novega produkta z generiranjem enkratnega časovno omejenega gesla (OTP). Imejte 24 ur na dan, 365 dni v letu pregled nad svojim portfeljem, ki ga lahko aktivno prilagajate, pa naj bo iz to domačega naslonjača ali pa kjerkoli vam ustreza. Vlagatelji, ki imajo urejeno pooblastilo za drugega vlagatelja, pa imajo vpogled in možnost opravljanja prenosov sredstev v imenu tega vlagatelja.

Aplikacija Generali Investments vam omogoča popolni izkoristek časa in fleksibilnost, saj z njo lahko: 
- pregledujete tečajnico skladov in za poljuben pretekli dan izberite prikaz za dnevno, enoletno, triletno in petletno spremembo VEP vseh podskladov Generali Krovnega sklada;  
- spoznate posamezen sklad, prek nazornega grafa pa spremljate in analizirate njegovo uspešnost; 
- brez obiska poslovalnice, varno in enostavno uredite pristop k podskladom Generali Krovnega sklada z video identifikacijo; 
- prebirate najnovejša obvestila in strokovne članke; 
- najdete vam najbližjo poslovalnico; 
- kot prijavljen uporabnik ne le spremljate aktualno stanje naložb, ampak jih lahko tudi aktivno prilagajate, saj vam je omogočen enostaven prenos med našimi podskladi; 
- vsi prijavljeni uporabnik varno sklepate nov produkt z generiranjem enkratnega časovno omejenega gesla (OTP).

V mobilno aplikacijo se lahko vlagatelji Generali Investments (fizične osebe) prijavite s prijavni podatki naše spletne poslovalnice ali pa prek registracijskega postopka ustvarite uporabniški profil.

